--- Image data used in the UI dialogs.
--
-- The Shaderfuses icon (that yellowish dark side of the moon app icon kind of thing) is intended to be used in different dialogs.
-- Additionally we use that JiPi/nmbr73 'Shaderfuses' logo. For both the image data is needed in base64 format, and having these
-- gigantic strings here they don't clutter the other files.
--
-- @module image



local image = {}



-------------------------------------------------------------------------------------------------------------------------------------------
-- Internal create a `Label` helper function.
--
-- @param[type=fu.UIManager] fusion_ui_mngr The Fusion UI manager instance.
-- @param[type=string] data The image's PNG data as a base64 encoded string.
-- @param[type=int] width The image width in number of pixel.
-- @param[type=int] height The image height in number of pixel.
--
local function label(fusion_ui_mngr,data,width,height)
  return fusion_ui_mngr:Label{
    ID = "",
    WordWrap = false,
    Weight = 0,
    MinimumSize = { width, height },
    ReadOnly = true,
    Flat = true,
    Alignment = { AlignHCenter = false, AlignTop = true, },
    Text = '<img src="data:image/png;base64,'..data..'" width="'..width..'" height="'..height..'" />',
  }
end



-------------------------------------------------------------------------------------------------------------------------------------------
-- Create a `Label` containing the icon.
--
function image.icon_label(fusion_ui_mngr)
    return label(fusion_ui_mngr,
      ''
      ,42,42)
end



-------------------------------------------------------------------------------------------------------------------------------------------
-- Create a `Label` containing the logo.
--
function image.logo_label(fusion_ui_mngr)
  return label(fusion_ui_mngr,
  ''
    ,274,63)
end



return image
